import logo from './logo.png';
import './App.css';
import Navbar from "./components/Navbar";
import Content from "./components/Content";


class App extends Component {
    render() {
        return (
            <div className="App">
                <Navbar/>

                <Home/>

                <Content>
                    <h1> Kommande Evenemang: </h1>
                    <ul>
                        <li>Fredagspub</li>
                        <li>Fredagspub</li>
                    </ul>
                </Content>

            </div>
        );
    }
}

export default App;
